const arr = [
    {
      id : 1,
      ques : "What is your Name ?",
      ans: "My Name is Kaif"
    },  
    {
      id : 2,
      ques : "What is your Age ?",
      ans: "My Age is 21"
    },  
    {
      id : 3,
      ques : "What is your Job ?",
      ans: "My Job is MERN Dev."
    },  
    {
      id : 4,
      ques : "What is your Future Plan ?",
      ans: "Wanted to be Billionare"
    },  
    {
      id : 5,
      ques : "What is your End ?",
      ans: "Peacefull"
    },  
]
export default arr ;
